const Navbar = ({data}) => {

    return (
        <div className='pt-4'>
            <div className='flex justify-between h-10 px-5'>
               {data.map((result)=>{
                return(
                    <>
                     <div className='mt-2'></div>
                <div>

                    <div>
                        <button className='mt-2 mx-1 font-boldmd'>My Orders</button>
                        <span className='mt-2 mx-1 font-boldmd'>Cart</span>
                    </div>


                </div>

                    </>
                )
               })}
            </div>


        </div>
    )
}

export default Navbar
